INSERT INTO `block_custom` VALUES (1,'Custom action text here.','Custom text block ','filtered_html'),(2,'Custom text 2 here.','Custom text block 2','filtered_html'),(3,'GIT Slike, reprodukcije slika na slikarskom platnu\r\n\r\nGIT Slike se bave proizvodnjom i prodajom reprodukcija umetnickih dela digitalnom stampon na slikarskom platnu CANVAS.\r\n\r\nSvaka slika proizvedena kod nas je uramljena u BLIND ram (pozadinski ram koji drzi platno zategnutim). Platno prevuceno i dodatno odstampano preko ivice rama tako da dodatno uramljivanje nije potrebno.\r\n\r\nPored gotovih slika koje mozete pogledati u nasoj GALERIJI  radimo i SLIKE PO PORUDZBINI sa vasih fotografija.\r\n\r\nMaksimalna dimenzija stampe 70X400cm\r\n\r\nOno sto nas izdvaja iz mora ostalih koji se bave ovim poslom je izuzetno visok kvalitet stampe i izuzetno niska cena .\r\n\r\nIzaberite sliku za Vaš zid ili savršen poklon\r\n\r\nVršimo isporuku u sve gradove Srbije kurirskom sluzbom. Vaše je da se odlučite za sliku , da nas kontaktirate i slika je na Vašim vratima u roku od 1 dana!','O nama','filtered_html');
/*!40000 ALTER TABLE `block_custom` ENABLE KEYS */;
UNLOCK TABLES;
commit;

